/* eslint-disable import/no-anonymous-default-export */
export default() => {
    return(

        <div class="formuario">
             <form class="row g-3" stylo="boder:1px;">
   <div class="col-auto">
     <label for="cpf" class="visually-hidden">CPF</label>
     <input type="cpf" class="form-control" id="cpf" placeholder="Digite seu CPF"/>
   </div>
 </form>
 </div>

    );
}
